import styled from 'styled-components'

const StyledPanelEdit = styled.div`
    display: flex;
    position: absolute;
    top: 2px;
    width: 42px;
    right: 23px;
    height: 28px;

    label {
      margin-top: 6px !important;
    }
`
export default StyledPanelEdit
